import React, { useState } from 'react';
import "./table.css"

const Table = ({ data }) => {
    const [searchTerm, setSearchTerm] = useState('');
    const [searchService, setSearchService] = useState('');
    const [searchCompany, setSearchCompany] = useState('');
    const [searchAttackerIP, setSearchAttackerIP] = useState('');
    const [searchTrapName, setSearchTrapName] = useState('');
    const ROWS_PER_PAGE = 10;

    const handleSearch = (event) => {
        setSearchTerm(event.target.value);
        setCurrentPage(1);
    };

    const handleSearchService = (event) => {
        setSearchService(event.target.value);
        setCurrentPage(1);
    };

    const handleSearchCompany = (event) => {
        setSearchCompany(event.target.value);
        setCurrentPage(1);
    };

    const handleSearchAttackerIP = (event) => {
        setSearchAttackerIP(event.target.value);
        setCurrentPage(1);
    };

    const handleSearchTrapName = (event) => {
        setSearchTrapName(event.target.value);
        setCurrentPage(1);
    };

    const filteredData = data.filter((item) =>
        item.attackerIP.includes(searchAttackerIP) &&
    item.serviceName.toLowerCase().includes(searchService.toLowerCase()) && item.company.toLowerCase().includes(searchCompany.toLowerCase()) && item.trapName.toLowerCase().includes(searchTrapName.toLowerCase())
    );

    const totalPages = Math.ceil(filteredData.length / rowsPerPage);
    const startIndex = (currentPage - 1) * rowsPerPage;
    const endIndex = startIndex + rowsPerPage;

    return (
        <div>
            <p>
                <label htmlFor="username-input">Filter By Service Name:</label>
                <input
                    type="text"
                    value={searchService}
                    id="serviceName"
                    onChange={handleSearchService}
                    placeholder="Search by Service Name"
                />
            </p>
            <p>
                <label htmlFor="username-input">Filter By Date:</label>
                <input
                    type="Date"
                    value={searchTerm}
                    id="fromDate"
                    onChange={handleSearch}
                    placeholder="From Date"
                />
                <input
                    type="Date"
                    value={searchTerm}
                    id="toDate"
                    onChange={handleSearch}
                    placeholder="To Date"
                />
            </p>
            <p>
                <label htmlFor="username-input">Filter By Company:</label>
                <input
                    type="text"
                    value={searchCompany}
                    id="company"
                    onChange={handleSearchCompany}
                    placeholder="Search by Company"
                />
            </p>
            <p>
                <label htmlFor="username-input">Filter By Attacker IP:</label>
                <input
                    type="text"
                    value={searchAttackerIP}
                    id="attackerIP"
                    onChange={handleSearchAttackerIP}
                    placeholder="Search by Attacker IP"
                />
            </p>
            <p>
                <label htmlFor="username-input">Filter By Trap Name:</label>
                <input
                    type="text"
                    value={searchTrapName}
                    id="trapName"
                    onChange={handleSearchTrapName}
                    placeholder="Search by Trap Name"
                />
            </p>
            <table>
                <thead>
                <tr>
                    <th>Report ID</th>
                    <th>Service Name</th>
                    <th>Date</th>
                    <th>Company</th>
                    <th>Attacker IP</th>
                    <th>Trap Name</th>
                    <th>Session INFO</th>
                </tr>
                </thead>
                <tbody>
                {filteredData
                    .slice((currentPage - 1) * ROWS_PER_PAGE, currentPage * ROWS_PER_PAGE)
                    .map((item) => (
                        <tr key={item.reportID}>
                            <td>{item.reportID}</td>
                            <td>{item.serviceName}</td>
                            <td>{item.date}</td>
                            <td>{item.company}</td>
                            <td>{item.attackerIP}</td>
                            <td>{item.trapName}</td>
                            <td>{item.sessionINFO}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
            <div>
                <button onClick={() => setCurrentPage(currentPage - 1)} disabled={currentPage === 1}>
                    Previous
                </button>
                <button
                    onClick={() => setCurrentPage(currentPage + 1)}
                    disabled={currentPage === Math.ceil(filteredData.length / ROWS_PER_PAGE)}
                >
                    Next
                </button>
            </div>
        </div>
    );
};

export default Table;
